def analyze(data):
    data = json.loads(data)

    c = []

    for item in data:
        year = int(item['year'])
        month = int(item['month'])
        day = int(item['day'])

        d = date(year, month, day)
        low = item['y_margin_min']
        high = item['y_margin_max']
        y = item['y']

        c.append({'date': d.isoformat(), 'min': low, 'max': high, 'mass': y})

    return c


def write_csv(iterable, filename, fieldnames=None):
    with open('{}.csv'.format(filename), 'w', newline='') as f:
        if fieldnames is None:
            fieldnames = list(iterable[0].keys())

        writer = csv.DictWriter(f, fieldnames)

        writer.writeheader()
        writer.writerows(iterable)


data = analyze(greenland)
write_csv(data, 'greenland_mass', ['date', 'min', 'max', 'mass'])